import React from 'react';
import './App.css';
import { Navbar } from './layouts/NavbarAndFooter/Navbar';
import { ExploreTopBook } from './layouts/NavbarAndFooter/HomePage/components/ExploreTopBook';
import { Carousel } from './layouts/NavbarAndFooter/HomePage/components/Carousel';
import { Heros } from './layouts/NavbarAndFooter/HomePage/components/Hores';
import { LibraryServices } from './layouts/NavbarAndFooter/HomePage/components/LibraryService';
import { Footer } from './layouts/NavbarAndFooter/Footer';

function App() {
  return (
    <div>
      <Navbar/>
      <ExploreTopBook/>
      <Carousel/>
      <Heros/>
      <LibraryServices />
      <Footer/>
    </div>

  );
}

export default App;
